import React, { Component } from 'react';
import '../Projects.css'

class Projects extends Component {
  render() {
    return (
      <div style={{"position":"relative"}}>

        <div style={{"width":"100%","height":"100%","position":"absolute"}} uk-scrollspy="cls: uk-animation-slide-left-small; target: > div > .uk-card; delay: 500; repeat: true">
          <div className="skew"></div>
          <div className="skew2"></div>
        </div>

        <div style={{}}>
          <div style={{"width":"50%"}}>
            <div class="uk-card uk-card-default uk-card-body" style={{"position":"absolute","width":"310px","height":"415px","backgroundColor":"#84a3ff"}}></div>
            <div
              style={{"background":"rgba(0,0,0,0)","box-shadow":"0 0px 0px rgba(0,0,0,0)"}}
              class="uk-card uk-card-default uk-card-body"
            >
                <img src="pictures/me.jpg" width="415px" height="310px" alt="" uk-img/>
            </div>
          </div>
          <div style={{"height":"400px","width":"50%"}} class="uk-card uk-card-default uk-card-body">
              <h3 class="uk-card-title">Brian Yu</h3>
              <p>Design</p>
              <p>Architecture</p>
              <p>Code</p>
          </div>
        </div>

      </div>
    );
  }
}

export default Projects;
